import React, {useState} from 'react'
function Game () {
    const [score, setScore] = useState(0);
    const handleImageClick = () => {
        setScore(score + 1)
    }
    return (
        <div>
            <div id='game container'>
                <div id ='score'>Score: {score}</div>
                <img src='https://cdn.britannica.com/75/124975-050-32A8692C/Aishwarya-Bachchan-Rai.jpg'></img>
            </div>
        </div>
    )
}
export default Game;
